"Когда Поставщик сетевого расположения открыт, Байду сервис будет собирать анонимные данные о местоположении. Некоторые данные могут быть зашифрованы и сохранены на вашем устройстве. Шифрование и сбор может произойти, даже когда ни одно приложение не запущено. Вы будете платить за используемый трафик. Данные, зашифрованные и собранные будут использованы для получения информации о местоположении и повышение производительности и точности. Мы обещаем, что собранные данные не будут предоставляться третьим лицам или использоваться для иных целей, кроме предоставления услуг. Данные включают в себя: 
- Идентификатор, уровень сигнала точек доступа WLAN вокруг; 
- Идентификатор, уровень сигнала базовой станции (для GSM); 
- Идентификатор, уровень сигнала базовой станции (для CDMA)."
